import "./stories.scss"; 
import friend4 from "../../Assets/UnitedSikhs.jpeg";

export default function Stories() {
    //TEMPORARY DUMMY DATA 
    const stories = [
        {
            id: 1, 
            name: "United Sikhs", 
            img: "data:image/png;base64,"
        },
        {
            id: 2, 
            name: "Internet Society", 
            img: {friend4}
        },
        {
            id: 3, 
            name: "United Sikhs", 
            img: {friend4}
        },
        {
            id: 4, 
            name: "United Sikhs", 
            img: {friend4}
        },
        {
            id: 5, 
            name: "United Sikhs", 
            img: {friend4}
        },
        {
            id: 6, 
            name: "United Sikhs", 
            img: {friend4}
        }
    ]
    return (
        <div className="stories">
            {stories.map(story =>(
                <div className="story">
                    <img src={story.img} alt="" />
                    <span>{story.name}</span>
                </div>
            ))}
        </div>
    )
};
